tables.table_schema:
CREATE TABLE EarthquakeData (
    id INT PRIMARY KEY,
    latitude FLOAT,
    longitude FLOAT,
    magnitude FLOAT
);

CREATE TABLE VisualizationData (
    id INT PRIMARY KEY,
    location_name VARCHAR(255),
    visual_data JSON
);

CREATE TABLE EarthquakeData (
  id UUID PRIMARY KEY,
  coordinates GEOGRAPHY,
  magnitude FLOAT
);

CREATE TABLE EarthquakeLocations (
  location_id UUID PRIMARY KEY,
  location_name TEXT,
  latitude FLOAT,
  longitude FLOAT
);

CREATE TABLE MagnitudeLevels (
  level_id UUID PRIMARY KEY,
  level_name TEXT,
  min_magnitude FLOAT,
  max_magnitude FLOAT
);

CREATE TABLE Earthquake_Data (
  id UUID PRIMARY KEY,
  latitude DECIMAL,
  longitude DECIMAL,
  magnitude FLOAT
);

CREATE TABLE Seismic_Events (
  event_id UUID PRIMARY KEY,
  location VARCHAR,
  date TIMESTAMP,
  intensity INT
);

CREATE TABLE Seismic_Map (
  map_id UUID PRIMARY KEY,
  event_id UUID,
  latitude DECIMAL,
  longitude DECIMAL
);

CREATE TABLE Seismic_Analysis (
  analysis_id UUID PRIMARY KEY,
  event_id UUID,
  magnitude_level INT,
  analysis_result TEXT
);

CREATE TABLE EarthquakeLocations (
  id SERIAL PRIMARY KEY,
  latitude FLOAT,
  longitude FLOAT,
  magnitude FLOAT
);

CREATE TABLE EarthquakeMagnitudes (
  id SERIAL PRIMARY KEY,
  earthquake_id INT,
  magnitude FLOAT,
  FOREIGN KEY (earthquake_id) REFERENCES EarthquakeLocations(id)
);

CREATE TABLE EarthquakeTime (
  id SERIAL PRIMARY KEY,
  earthquake_id INT,
  timestamp TIMESTAMP,
  FOREIGN KEY (earthquake_id) REFERENCES EarthquakeLocations(id)
);

CREATE TABLE EarthquakeDepth (
  id SERIAL PRIMARY KEY,
  earthquake_id INT,
  depth FLOAT,
  FOREIGN KEY (earthquake_id) REFERENCES EarthquakeLocations(id)
);
